  05> WIGLEY, Richard Thomas Cranstoun m on 26.10.1974 to BYLES, Nancy Dianne
  b 24.10.1947
  b 03.05.1948
  Richard b. at Whangarei and m, at Hikurangi. Nancy, d/o Wilfred Byles and Dorothy Sands, b. at
  Whangarei. Address: Church Road, RD 2, Kaitaia.
  Richard and Nancy are sheep and cattle farmers.
