  04>' WILLIAMS, George Alexander m on **.09.1928 to (2) SUGDEN, Ann
  b 24.11.1861 d 08.11.1938
  b ** ** **** d ** ** ****
  Ann was a nurse.
  05> WILLIAMS, Evelyn Maud
  b 24.11.1863 d 22.07.1935
  Evelyn b. at Pakaraka. She worked at Brockenhurst Hospital, England during WW1 but returned to live in
  Gisborne.
  06> WILLIAMS, Percy Temple m on 10.12.1907 to PIERCE, Mary Isobel
  b 19.03.1866 d 12.10.1933
  b 16.04.1871 d 10.07.1950
  Percy b. at Pakaraka and d. at Auckland. Percy was educated at Christ's College (1883-1886); Jesus College,
  Cambridge (MA, 1890) and was a Cambridge Rugby Football Blue. He was ordained in England in 1890 and was curate
  at St Bartholomew's, London (1890) and St Sepulchre's, Auckland (1893) He served in the Melanesian Mission
  (1895-1906). He was Warden at St John's College, Auckland (1906-14) and Captain-Chaplain in the 8th
  Reinforcements NZEF in Egypt (1915-16). He was canon of Auckland Cathedral (1914-24) and retired to Paihia.
  01> WILLIAMS, Patrick Heathcote Temple m on 07.05.1949 to STRACK, Monica Jean
  b 25.04.1909 d 04.03.1974
  b 01.07.1919
  | Patrick b. at London, England. Monica, d/o George and Ann Strack, b. at
  Palmerston North. Address: 6 Desmond Street, Fendalton, Christchurch.
  Patrick was educated at Christ's College (1921-27, Head of School, Somes Scholar,
  Ormsby Medal). He graduated BA(Cantab) in 1931 and was a Captain in the First
  Battalion of the Fiji Military Forces. He graduated MA(Cantab) 1946. Patrick was a
  Master at Christ's College from 1932 until he retired in 1973.
  Monica was educated at Rangi Ruru School, Christchurch (1929-36). She gained her Kindergarten Diploma and
  taught in Christchurch from 1937 until she married.
  01> WILLIAMS, Rosemary Anne m on 08.12.1973 to HEDGE, Brian James
  b 03.06.1950
  b 15.03.1950
  Rosemary b. at Christchurch and m. at Christ's College Chapel, Christchurch. Brian, s/o Edward James
  Hedge and Nancy Susan Johns, b. at Otahuhu, Auckland. Address: 80 Cairo Street, Cammeray 2062, NSW,
  Australia.
  Rosemary was educated at St Margaret's College, Christchurch (1955-67) and Canterbury University (BA).
  She has taught in Auckland and Malaysia, where her family lived for four years. She is now living in
  Sydney where Brian, an accountant, is currently based.
  01> HEDGE, Rachel Georgina
  b 23.03.1977
  Rachel b. at Howick, Auckland. She is studying towards a BSc/BComm degree at Auckland University.
